import React from "react";
import { ListGroupItem } from "reactstrap";
import styled from "styled-components";

const ItemWrapper = styled(ListGroupItem)`
  .completed {
    text-decoration: line-through;
  }
`;

const Item = {
  value: { title, completed },
  index,
  deleteTask,
  editTask,
  toggleCompleted,
};

export default Item;
